 class Prices extends   React.Component {
    
   state={
       currency:'USD'
   }
    render() {
        
        return (
            <div>
               <ul className="list-group">
                   <li className="list-group-item">
                       Bitcoin rates for {this.props.bpi.time}:
        <span className="badge badge-primary">{this.props.bpi.disclaimer}</span>
        <strong>{this.props.bpi.bpi}</strong>
                   </li>
               </ul>
            </div>
        )
    }
}

export default Prices
